/**
 *  THIS QUESTION IT SELF IS LIT 
 *  EDGE CASE LIKE WHAT IF ARR.LENGTH IS LESS THEN K IN THAT CASE K IT SELF WILL BE THE ANSWER
 *  WHAT IF K IS 0
 *  FINALLLLLLY DONE BY SELF ONLY MISTAKE WAS I WAS NOT THINKING IN TWO POINTER OR SLIDING WINDOW PROBLEM
 */
function maxConsecutiveOne(arr,k){
 if(arr.length <= k) return k  
 let i = 0;
 let j = 0;
 let balance = k;
 let current = 0, max = 0; // NEVER BE OVER SMART let current , max = 0 ; this won't give 0 value to both current will be undefined 

 while(i < arr.length){
  while(arr[i] === 0 && balance > 0){
      current++;
      balance --;
      i++;
    }
   
    while(arr[i] ===  1){
      current++;
      i++;
    }
  while(balance === 0 && arr[i] === 0){
      if(current > max) max = current;
      // this is the place where your balance is 0 and thats the max you can reach now
      // if you wanted to reach further then you may need to release previous one
      while(arr[j] !== 0){
         j++;
      }
      j++;

      current = i - j;
      balance = 1;
    }
   
    // you released one
 }

 return Math.max(current,max);  // EDGE CASE HE BHAI
}

